import React from "react"
import PropTypes from "prop-types"
import { Nav, NavItem, NavLink } from 'reactstrap'
import { BrowserRouter as  Router, Route, Link } from 'react-router-dom'

import Apartments from './Apartments'
import Info from './Info'
import NewApartment from './NewApartment'

class MainApp extends React.Component {
  render () {
    const {
      logged_in,
      sign_in_route,
      sign_out_route
    } = this.props

    return (
      <React.Fragment>
      <div class="jumbotron jumbotron-fluid backgroundImg">
        <div class="container">
          <h1 class="display-4">Apartment App</h1>
        </div>
      </div>
      <Router>
      <div>
      <nav class="navbar navbar-expand-lg">
        <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
          <div class="navbar-nav">
            <NavLink to="/list" tag={Link}>Apartments</NavLink>
            <NavLink to="/info" tag={Link}>Info</NavLink>
            <NavLink to="/new" tag={Link}>New Apartment</NavLink>
            {logged_in &&
          <div>
            <a href={sign_out_route} class="signInOut">Sign Out</a>
              </div>
            }
            {!logged_in &&
              <div>
                <a href={sign_in_route}>Sign In</a>
              </div>
            }
          </div>
        </div>
      </nav>
          <Route path="/list" component={Apartments} />
	        <Route path="/info" component={Info} />
	        <Route path="/new" component={NewApartment} />
	        </div>
	     </Router>






      </React.Fragment>
    );
  }
}

export default MainApp

